  true,\n\t\"url\": null,\n\t\"notes\": \"The Solar Metrics Online Portal collects
  data from teams participating in the Rooftop Solar Challenge (RSC II). The data
  is collected from each jurisdiction on a team over three time periods (past, present,
  and future). The data collected is used to calculate a teamu2019s market maturity
  using the Solar Market Maturity Model (SM3). The SM3 is organized around four Action
  Areas: Permitting and Interconnection; Financing; Planning and Zoning; and Net Metering
  and Interconnection Standards. Each teamu2019s data is translated into a score with
  a maximum of 1000.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
